import React, { useEffect, useState } from 'react';
import LeagueMatchupCarousel from './LeagueMatchupCarousel';
import Announcements from './Announcements';
import UpcomingEvents from './UpcomingEvents';

function HomePage({ leagueId, userRosterId }) {
  const [announcements, setMessages] = useState([]);
  const [events, setEvents] = useState([]);
  const [drawerOpen, setDrawerOpen] = useState(false);

  const colors = {
    background: '#121212',
    gold: '#b68b2f',
    cream: '#f2f0e6',
    brown: '#6f4f2e'
  };

  useEffect(() => {
    fetch('/api/announcements')
      .then(res => res.json())
      .then(data => setMessages(data))
      .catch(err => console.error('Error fetching announcements:', err));

    fetch('/api/events')
      .then(res => res.json())
      .then(data => setEvents(data))
      .catch(err => console.error('Error fetching events:', err));
  }, []);

  return (
    // Add at the top of return() in HomePage component
<div
  style={{
    position: 'fixed',
    top: '1rem',
    left: '1rem',
    zIndex: 1000,
    backgroundColor: '#121212',
    padding: '0.5rem',
    borderRadius: '6px',
    cursor: 'pointer',
    boxShadow: '0 2px 8px rgba(0, 0, 0, 0.4)',
  }}
  onClick={() => console.log('Menu clicked')} // replace with actual menu logic
>
  <div style={{ width: '25px', height: '3px', backgroundColor: '#f2f0e6', margin: '4px 0' }} />
  <div style={{ width: '25px', height: '3px', backgroundColor: '#f2f0e6', margin: '4px 0' }} />
  <div style={{ width: '25px', height: '3px', backgroundColor: '#f2f0e6', margin: '4px 0' }} />

      {/* Sidebar Drawer */}
      <div
        style={{
          position: 'fixed',
          top: 0,
          left: drawerOpen ? 0 : '-250px',
          width: '250px',
          height: '100%',
          backgroundColor: colors.background,
          color: colors.cream,
          boxShadow: '2px 0 10px rgba(0,0,0,0.5)',
          transition: 'left 0.3s ease',
          zIndex: 999,
          padding: '1.5rem',
          display: 'flex',
          flexDirection: 'column',
          gap: '1.5rem',
        }}
      >
        <button
          onClick={() => setDrawerOpen(false)}
          style={{
            alignSelf: 'flex-end',
            background: 'none',
            border: 'none',
            color: colors.gold,
            fontSize: '1.5rem',
            cursor: 'pointer'
          }}
        >
          √ó
        </button>

        <a href="#" style={{ color: colors.gold, textDecoration: 'none', fontWeight: '600' }}>üè† Home</a>
        <a href="#" style={{ color: colors.gold, textDecoration: 'none', fontWeight: '600' }}>üìã Matchups (WIP)</a>
        <a href="#" style={{ color: colors.gold, textDecoration: 'none', fontWeight: '600' }}>üôå Hall Of Fame (WIP)</a>
        <a href="#" style={{ color: colors.gold, textDecoration: 'none', fontWeight: '600' }}>üìú Constitution (WIP)</a>
        <a href="#" style={{ color: colors.gold, textDecoration: 'none', fontWeight: '600' }}>üìà Analytics (WIP)</a>
        <a href="#" style={{ color: colors.gold, textDecoration: 'none', fontWeight: '600' }}>üí∏ Payments (WIP)</a>
      </div>

      {/* Header with logo */}
      <header style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginBottom: '2rem' }}>
        <div
          style={{
            boxShadow: '0 4px 10px rgba(0, 0, 0, 0.5)',
            borderRadius: '12px',
            overflow: 'hidden',
            width: '100px',
            height: '100px',
            marginBottom: '1rem',
            transition: 'transform 0.3s ease'
          }}
          onMouseEnter={e => { e.currentTarget.style.transform = 'scale(1.05)'; }}
          onMouseLeave={e => { e.currentTarget.style.transform = 'scale(1)'; }}
        >
          <img
            src="https://sleepercdn.com/avatars/thumbs/6ad52c4e61b556cd98322c5a7405378e"
            alt="League Logo"
            style={{ width: '100%', height: '100%', objectFit: 'cover', display: 'block' }}
          />
        </div>
        <h1 style={{ color: colors.gold, fontSize: '2.5rem', fontWeight: 'bold', letterSpacing: '0.1em', textAlign: 'center' }}>
          League of Ordinary Gentlemen
        </h1>
      </header>

      {/* Ribbon */}
      <div
        style={{
          backgroundColor: colors.gold,
          color: colors.background,
          padding: '0.75rem 1.5rem',
          borderRadius: '30px',
          width: 'fit-content',
          margin: '0 auto 3rem auto',
          fontWeight: '600',
          letterSpacing: '0.1em',
          textTransform: 'uppercase',
          boxShadow: `0 0 15px ${colors.gold}`
        }}
      >
        Week 1 Matchup
      </div>

      {/* Carousel container */}
      <div style={{ width: '100vw', marginLeft: '-2rem' }}>
        <LeagueMatchupCarousel leagueId={leagueId} />
      </div>

      {/* Announcement Section */}
      <Announcements messages={announcements} />

      {/* Upcoming Events Section */}
      <UpcomingEvents events={events} />

      {/* Footer */}
      <footer style={{
        textAlign: 'center',
        marginTop: '4rem',
        fontSize: '0.875rem',
        color: colors.brown,
        letterSpacing: '0.05em',
      }}>
        <div>¬© 2025 League of Ordinary Gentlemen</div>
        <div style={{ marginTop: '0.5rem', display: 'flex', justifyContent: 'center', alignItems: 'center', gap: '0.5rem', fontSize: '0.85rem' }}>
          <span>Powered by</span>
          <a
            href="https://sleeper.app"
            target="_blank"
            rel="noopener noreferrer"
            style={{ color: colors.brown, textDecoration: 'none', display: 'flex', alignItems: 'center' }}
          >
            <img
              src="/sleeper_logo.png"
              alt="Sleeper"
              style={{ height: '15px' }}
            />
          </a>
        </div>
      </footer>
    </div>
  );
}

export default HomePage;
